let AssetModel = require("../../api/assets/assets.modal");
// import { guid } from "../UUID";

export async function addNHSLData() {
  await addAssets();
}

async function addAssets() {
  try {
    let line = await addLampAsset(lineAsset.unitId, lineAsset);
    let location = await AssetModel.findOne({ unitId: "City/Suburban" });
    if (location) {
      line.parentAsset = location._id;
      line.save();
    }
    let idMap = new Map();

    let lineId = line._id.toHexString();

    idMap.set(line.unitId, lineId);

    track1.lineId = lineId;
    track1.parentAsset = lineId;
    track1.attributes = JSON.parse(track1.attributes);
    let t1 = await addLampAsset(track1.unitId, track1);
    idMap.set(t1.unitId, t1._id.toHexString());
    let track1Id = t1._id.toHexString();

    for (let ast of lampT1NHSL) {
      ast.lineId = lineId;
      ast.trackId = track1Id;
      if (ast.parentAsset) {
        ast.parentAsset = idMap.get(ast.parentAsset);
      }
      if (typeof ast.attributes === "string") {
        ast.attributes = JSON.parse(ast.attributes);
      }

      let a = await addLampAsset(ast.unitId, ast);
      idMap.set(a.unitId, a._id.toHexString());
    }

    track2.lineId = lineId;
    track2.parentAsset = lineId;
    track2.attributes = JSON.parse(track2.attributes);
    let t2 = await addLampAsset(track2.unitId, track2);
    let track2Id = t2._id.toHexString();

    for (let st of stations) {
      st.lineId = lineId;
      st.parentAsset = lineId;
      await addLampAsset(st.unitId, st);
    }

    let t1Assets = trackDataAssets(track1Data);

    for (let ast of t1Assets) {
      ast.lineId = lineId;
      ast.trackId = track1Id;
      ast.parentAsset = track1Id;
      await addLampAsset(ast.unitId, ast);
    }

    let t2Assets = trackDataAssets(track2Data);

    for (let ast of t2Assets) {
      ast.lineId = lineId;
      ast.trackId = track2Id;
      ast.parentAsset = track2Id;
      await addLampAsset(ast.unitId, ast);
    }
  } catch (err) {
    console.log("Septa-NHSL, addAssets, error: ", err.toString());
  }
}
async function addLampAsset(unitId, newAst, createCallback = (err, obj) => {}) {
  let ast = await AssetModel.findOne({ unitId: unitId });
  if (!ast) {
    console.log("adding asset", unitId);
    
      if(typeof newAst.start==="string")
      {
        newAst.start=+(parseFloat(newAst.start).toFixed(2));
      }

      if(newAst.end==="")
      {
        newAst.end=+newAst.start;
        //console.log('parsed', newAst.end);
      }

      if(typeof newAst.end==="string")
        newAst.end = +(parseFloat(newAst.end).toFixed(2));

    if(newAst.assetLength==="")
      newAst.assetLength = newAst.end - newAst.start;

    return await AssetModel.create(newAst);
  }
  return ast;
}

